actionConfiguration.body:
() => {
		let studentList = NameList.data
		let studentIsPresent = false
		for(let i = 0;i<=studentList.length;i++){
			let studentInfo = studentList[i]
			if (studentInfo && studentInfo.name && Name.text == studentInfo.name){
			studentIsPresent = true
			break
		}
		}
		if(studentIsPresent){
         showAlert(Name.text + " already exists")
    }
	}

